import React from "react";
import { useNavigate } from "react-router-dom";
import { FiLogOut, FiSettings, FiHome } from "react-icons/fi";

export default function Home({ onLogout }) {
  const navigate = useNavigate();
  return (
    <div style={{
      minHeight: "100vh",
      background: "linear-gradient(120deg,#101824 0%,#1c2740 100%)",
      color: "#fff",
      fontFamily: "Segoe UI, Inter, Arial, sans-serif",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      paddingTop: 15,
      paddingBottom: 15,
    }}>
      {/* Bot√£o Casa - Canto superior esquerdo */}
      <button
        onClick={() => navigate("/")}
        style={{
          position: "absolute",
          left: 25,
          top: 25,
          background: "#121e38",
          border: "none",
          borderRadius: 9,
          padding: 9,
          color: "#0eb8d0",
          fontSize: 24,
          cursor: "pointer"
        }}
        title="Tela Inicial"
      >
        <FiHome />
      </button>

      {/* Bot√µes - Canto superior direito */}
      <div style={{ position: "absolute", right: 25, top: 25, display: "flex", gap: 16 }}>
        <button
          onClick={() => navigate("/configuracoes")}
          style={{
            background: "#121e38", border: "none", borderRadius: 9, padding: 9,
            color: "#0eb8d0", fontSize: 24, cursor: "pointer"
          }}
          title="Configura√ß√µes"
        >
          <FiSettings />
        </button>
        <button
          onClick={onLogout}
          style={{
            background: "#121e38", border: "none", borderRadius: 9, padding: 9,
            color: "#ff7c7c", fontSize: 24, cursor: "pointer"
          }}
          title="Sair"
        >
          <FiLogOut />
        </button>
      </div>

      <img 
        src="/venoai-logo.png" 
        alt="VENO.AI" 
        style={{ 
          width: 120, 
          marginBottom: 10, 
          filter: "drop-shadow(0 6px 20px #00e0ff90)",
          animation: "logoGlow 3s ease-in-out infinite alternate"
        }}
      />

      <div style={{ margin: "10px 0 15px", fontSize: 14, color: "#abfaff" }}>
        Selecione o tipo de exame para continuar:
      </div>

      <div style={{
        display: "grid",
        gridTemplateColumns: "repeat(2, 1fr)",
        gap: 10,
        width: "100%",
        maxWidth: 600,
        padding: "0 20px"
      }}>
        <MenuButton label="MMII Venoso" onClick={() => navigate("/mmii-venoso")} />
        <MenuButton label="MMII Arterial" onClick={() => navigate("/mmii-arterial")} />
        <MenuButton label="MMSS Venoso" onClick={() => navigate("/mmss-venoso")} />
        <MenuButton label="MMSS Arterial" onClick={() => navigate("/mmss-arterial")} />
        <MenuButton label="Car√≥tidas e Vertebrais" onClick={() => navigate("/carotidas-vertebrais")} />
        <MenuButton label="Aorta e Il√≠acas" onClick={() => navigate("/aorta-iliacas")} />
        <MenuButton label="Art√©rias Renais" onClick={() => navigate("/arterias-renais")} />
        <MenuButton label="Exames Realizados" onClick={() => navigate("/exames-realizados")} />
      </div>

      <style>
        {`
          @keyframes logoGlow {
            0% {
              filter: drop-shadow(0 8px 25px #00e0ff90);
            }
            100% {
              filter: drop-shadow(0 12px 35px #00e0ffc0);
            }
          }
        `}
      </style>
    </div>
  );
}

function MenuButton({ label, onClick }) {
  return (
    <button
      onClick={onClick}
      style={{
        width: "100%",
        background: "#0eb8d0",
        color: "#fff",
        fontWeight: 600,
        fontSize: 14,
        padding: "10px 8px",
        border: "none",
        borderRadius: 10,
        cursor: "pointer",
        letterSpacing: 0.5,
        boxShadow: "0 2px 10px #00e0ff30",
        transition: ".2s",
        minHeight: 45,
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        textAlign: "center",
        lineHeight: 1.3
      }}
      onMouseEnter={(e) => {
        e.target.style.background = "#0ca8b8";
        e.target.style.transform = "translateY(-2px)";
        e.target.style.boxShadow = "0 4px 15px #00e0ff50";
      }}
      onMouseLeave={(e) => {
        e.target.style.background = "#0eb8d0";
        e.target.style.transform = "translateY(0)";
        e.target.style.boxShadow = "0 2px 10px #00e0ff30";
      }}
    >
      {label}
    </button>
  );
}
